A discrimated union (DU) is a typed union. It can be used to create a hierarchical type structure easily. And Du's are generating a default constructor and a ToString method. You will see that discrimated unions are saving a lot of lines of code. The structure of DU's: <du_prop> ::= "mutable"? <name> ":" <type>
<du_prop_list> ::= <du_prop> "," <du_prop_list> | <du_prop>
<du_type_def> ::= "|" <name> "(" <du_prop_list> ")"
<du_definition> ::= "type" <name> "=" <du_type_def>* ";" For example we will create a simple DU for an abstract syntax tree: public type Expression = | Literal(Value : obj) | Group(Inner : Expression) | Binary(Lhs : Expression, Operator : string, Rhs : Expression); The normal equivalent class structure would be: public abstract class Expression { } public class Literal { let Value : obj;
} implement Literal { public constructor(value : obj) { Value = value; }
} public class Group { let Inner: Expression;
} implement Group { public constructor(inner : Expression) { Inner = inner; }
} public class Binary { let Lhs: Expression; let Rhs: Expression;
} implement Binary { public constructor(lhs : Expression) { Lhs = lhs; Rhs = rhs; }
}

