An interface describes a contract between different objects. If a class implements an interface the instanciator knows that all members are implemented. You can also inherit from other interfaces to combine many interfaces into one name. Interface names should start with an I. The syntax of an interface: <interface_list> ::= <name> "," <interface_list> | <name>
<interface_declaration> ::= <modifiers> "interface" <name> (":" <interface_list>)? "{" <declarations> "}" Here a little example: public interface IComparable { func Compare(left : obj, right : obj) -> bool;
} public class MyCustomObject : IComparable { } implement MyCustomObject { public func Compare(left : obj, right : obj) -> bool { return left == right; }
